  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. A consolidated city is a unit of local government for which the functions
  of an incorporatedn               place and its county or minor civil division (MCD)
  have merged. This action results in both the primary incorporated place and the
  county or MCDn               continuing to exist as legal entities, even though
  the county or MCD performs few or no governmental functions and has few or no elected
  officials. Wheren               this occurs, and where one or more other incorporated
  places in the county or MCD continue to function as separate governments, even though
  they haven               been included in the consolidated government, the primary
  incorporated place is referred to as a consolidated city. The Census Bureau classifies
  then               separately incorporated places within the consolidated city as
  place entities and creates a separate place (balance) record for the portion of
  then               consolidated city not within any other place. The boundaries
  of the 2010 Census consolidated cities are those as of January 1, 2010, as reported
  throughn               the Census Bureau's Boundary and Annexation Survey (BAS).\",\n\t\"license_title\":
